window.bookSummaryJSON = "<p>Selected by the Modern Library as one of the 100 best nonfiction books of all time.</p> <p>Described by the <i>Chicago Tribune</i> as \"a classic\", <i>The Rise of Theodore Roosevelt</i> stands as one of the greatest biographies of our time.</p> <p>The publication of <i>The Rise of Theodore Roosevelt</i> on September 14th, 2001 marks the 100th anniversary of Theodore Roosevelt becoming president.</p>"; 
